export enum PieceColor { 
    BLACK = 'b', 
    WHITE = 'w'
}

export enum PieceType {
    PAWN = 'pawn', 
    KING = 'king', 
    QUEEN = 'queen', 
    ROOK = 'rook', 
    KNIGHT = 'knight',
    BISHOP = 'bishop'
}

export interface PieceObject {
    color: PieceColor,
    type: PieceType
}
